'use strict';
var app = app || {};

(function() {
    var pdfHelper = {};
    var docProperties = {
        title: 'My Food Fournal',
        subject: 'My food journal on ' + new Date().getTime(),
        author: 'Jorge Asuaje',
        keywords: 'generated, javascript, web 2.0, ajax',
        creator: 'Jorge Asuaje'
    };
    var logoDataUri = 'data:image/png;base64,';
    var watermarkDataUri = 'data:image/png;base64,';

    pdfHelper.generatePDF = function(journal) {
        var doc = new jsPDF()

        doc = addWaterMark(doc);

        //Doc styling
        doc.setFontSize(12);
        doc.setFontStyle('bold');
        doc.setLineWidth(0.3);
        doc.setProperties(docProperties);
        var width = doc.internal.pageSize.width;

        //Header section
        doc.addImage(logoDataUri, 'PNG', 14, 10, 69, 20);


        //Daily Totals section
        var columns = ['Calories', 'Carbs', 'Protein', 'Fat'];
        var rows = [
            [
                journal.get('calories') + ' kcal',
                journal.get('carbs') + ' g',
                journal.get('protein') + ' g',
                journal.get('fat') + ' g'
            ]
        ];
        doc.text('Daily Totals', 14, 40);
        doc.line(14, 42, width - 14, 42);
        doc.autoTable(columns, rows, {
            startY: 46,
            theme: 'grid',
            headerStyles: { fillColor: 146 },
            styles: { fontSize: 15, fontStyle: 'bold', halign: 'center' }
        });

        //Macronutrients section
        columns = ['Carbs', 'Protein', 'Fat'];
        rows = [
            [
                journal.get('carbs') + ' %',
                journal.get('protein') + ' %',
                journal.get('fat') + ' %'
            ]
        ];
        doc.text('Macronutrients Ratios', 14, doc.autoTable.previous.finalY + 10);
        doc.line(14, doc.autoTable.previous.finalY + 12, width - 14, doc.autoTable.previous.finalY + 12);
        doc.autoTable(columns, rows, {
            startY: doc.autoTable.previous.finalY + 16,
            theme: 'grid',
            headerStyles: { fillColor: 146 },
            styles: { fontSize: 15, fontStyle: 'bold', halign: 'center', fillColor: false }
        });

        //Meals section
        columns = ['Food', 'Servings', 'Calories <kcal>', 'Carbs <g>', 'Protein <g>', 'Fat <g>'];
        rows = [];

        doc.text('Meals', 14, doc.autoTable.previous.finalY + 10);
        doc.line(14, doc.autoTable.previous.finalY + 12, width - 14, doc.autoTable.previous.finalY + 12);

        _.each(journal.get('meals').models, function(meal, index) {
            var tableTitle = meal.get('name') + ' - ' + meal.get('calories') + ' kcal';
            _.each(meal.get('ingredients').models, function(food) {
                rows.push([food.get('name') + ' - ' + food.get('brand'), food.get('servings'),
                    food.get('calories'),
                    food.get('carbs'),
                    food.get('protein'),
                    food.get('fat')
                ]);
            });
            rows.push(['', 'Total',
                meal.get('ingredients').nutrition('calories'),
                meal.get('ingredients').nutrition('carbs'),
                meal.get('ingredients').nutrition('protein'),
                meal.get('ingredients').nutrition('fat')
            ])

            doc.text(tableTitle, 14, doc.autoTable.previous.finalY + 20);
            doc.autoTable(columns, rows, {
                startY: doc.autoTable.previous.finalY + 24,
                theme: 'grid',
                tableLineColor: 0,
                tableLineWidth: 0.2,
                headerStyles: { textColor: 0 },
                styles: { fillColor: false, halign: 'center' },
                drawCell: function(cell, data) {
                    if (data.row.index === data.table.rows.length - 1) {
                        doc.setFontStyle('bold');
                    }
                }
            });
            rows = [];
        });

        doc.save('MyFoodJournal.pdf')
    };

    function addWaterMark(doc) {
        var totalPages = doc.internal.getNumberOfPages();
        var width = Math.round(doc.internal.pageSize.width);
        var height = Math.round(doc.internal.pageSize.height);
        var watermarkWidth = 120;

        for (var i = 1; i <= totalPages; i++) {
            doc.setPage(i);
            doc.addImage(watermarkDataUri, 'PNG', (width / 2) - (watermarkWidth / 2), (height / 2) - (watermarkWidth / 2), watermarkWidth, watermarkWidth);
        }

        return doc;
    }

    app.pdfHelper = pdfHelper;

})();
